rr refrigerator, and Carrera marble countertops. </p><p dir="ltr">Located in the heart of Chelsea, this Parlor Apartment is conveniently located near Chelsea Market, the trendy High Line, and New York's chic art gallery district. Also nearby are the Chelsea Market, the Chelsea Piers sports complex, the new Hudson River Park, and a wide variety of upscale restaurants and shops.<br></p>";s:13:"preview_image";s:51:"/assets/img/properties/sale/resized/test facade.jpg";s:14:"photo_carousel";a:8:{i:0;s:40:"/assets/img/properties/sale/Facade 1.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20150831145440.jpg";i:2;s:53:"/assets/img/properties/sale/large3-20150831145440.jpg";i:3;s:53:"/assets/img/properties/sale/large4-20150831145441.jpg";i:4;s:53:"/assets/img/properties/sale/large5-20150831145441.jpg";i:5;s:53:"/assets/img/properties/sale/large6-20150831145441.jpg";i:6;s:53:"/assets/img/properties/sale/large7-20150831145441.jpg";i:7;s:53:"/assets/img/properties/sale/large8-20150831145441.jpg";}s:10:"streeteasy";s:1:"1";s:17:"streeteasy_status";s:6:"active";s:2:"id";s:36:"b61b5e45-ef24-4f42-9ee8-08d5399845cf";s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:9:"amenities";a:5:{i:0;s:7:"balcony";i:1;s:10:"dishwasher";i:2;s:9:"fireplace";i:3;s:5:"patio";i:4;s:11:"washerDryer";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:47:"/assets/downloads/floorplan1-20151119171054.jpg";s:14:"street_address";s:20:"436 West 20th Street";s:8:"zip_code";s:5:"10011";s:9:"ownership";s:6:"rental";s:5:"rooms";s:1:"7";s:9:"apartment";s:6:"Parlor";s:8:"currency";s:7:"dollars";s:5:"_file";s:105:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/2015-08-31-436-west-20th-street.md";s:11:"_local_path";s:48:"/1-properties/2015-08-31-436-west-20th-street.md";s:10:"_order_key";i:1440993600;s:13:"datetimestamp";N;s:4:"date";s:17:"August 31st, 2015";s: