  Large two bedroom apartment in a well maintained DOORMAN/ELEVATOR building. Unit features spacious bedrooms, large windows, living room, separate kitchen with updated appliances. ​240 East 35th, The Murray Hill, is a 120-unit cooperative located in the thriving and historic Murray Hill neighborhood, is a pet-friendly cooperative with a full-time doorman, live-in superintendent, and gorgeous roofdeck with Empire State Building and Chrysler Building views. This post-war building built in 1956 also features a garage, a free bike room, laundry facility. The cooperative was converted from rental in 1985. Parents may buy with or for children and pied-a-terres are allowed. This location is convenient to all transportation, including Penn Station, Grand Central Station, the Long Island Expressway and the FDR Drive, as well as numerous restaurants and shopping.";s:13:"preview_image";s:51:"/assets/img/properties/sale/resized/240 East 35.jpg";s:14:"photo_carousel";a:1:{i:0;s:58:"/assets/img/properties/sale/240 East 35-20151220201351.jpg";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:0:"";s:5:"_file";s:130:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/1-new-york/rental/2015-12-20-240-east-35th-street-apt-4a.md";s:11:"_local_path";s:73:"/1-properties/1-new-york/rental/2015-12-20-240-east-35th-street-apt-4a.md";s:10:"_order_key";i:1450587600;s:13:"datetimestamp";N;s:4:"date";s:19:"December 20th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452031906;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:27:"240-east-35th-street-apt-4a";s:7:"_folder";s:26:"properties/new-york/rental";s:9:"_basename";s:41:"2015-12-20-240-east-35th-street-apt-4a.md";s:9:"_filename";s:38:"2015-12-20-240-east-35th-street-apt-4a";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:9:"permalink";s:55:"/properties/new-york/rental/240-east-35th-street-apt-4a";}}}s:19:"properties/new-york";a:4:{s:14:"rental/page.md";a:5:{s:6:"folder";s:19:"properties/new-york";s:4:"path";s:39:"