s:4:"path";s:64:"/1-properties/1-new-york/sale/2015-08-25-440-west-22nd-street.md";s:4:"file";s:34:"2015-08-25-440-west-22nd-street.md";s:3:"url";s:46:"/properties/new-york/sale/440-west-22nd-street";s:4:"data";a:61:{s:5:"title";s:20:"440 West 22nd Street";s:9:"site_root";s:21:"http://104.131.23.73/";s:5:"price";s:8:"17950000";s:17:"property_location";s:7:"Chelsea";s:13:"preview_image";s:51:"/assets/img/properties/sale/resized/440_west_22.jpg";s:14:"photo_carousel";a:14:{i:0;s:53:"/assets/img/properties/sale/large1-20150828100023.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20150828100059.jpg";i:2;s:53:"/assets/img/properties/sale/large3-20151119174937.jpg";i:3;s:53:"/assets/img/properties/sale/large4-20150828100125.jpg";i:4;s:53:"/assets/img/properties/sale/large5-20150828100116.jpg";i:5;s:53:"/assets/img/properties/sale/large6-20150828100134.jpg";i:6;s:53:"/assets/img/properties/sale/large7-20151119175300.jpg";i:7;s:53:"/assets/img/properties/sale/large8-20151119175317.jpg";i:8;s:53:"/assets/img/properties/sale/large9-20150828100227.jpg";i:9;s:54:"/assets/img/properties/sale/large10-20150828100146.jpg";i:10;s:54:"/assets/img/properties/sale/large11-20151119175343.jpg";i:11;s:54:"/assets/img/properties/sale/large12-20150828100244.jpg";i:12;s:54:"/assets/img/properties/sale/large13-20150828100255.jpg";i:13;s:54:"/assets/img/properties/sale/large14-20150828100237.jpg";}s:5:"specs";s:0:"";s:10:"floorplans";s:0:"";s:16:"additional_specs";a:1:{i:0;a:2:{s:11:"spec_labels";s:0:"";s:6:"result";a:1:{i:0;a:2:{s:9:"yes_or_no";b:0;s:5:"other";s:0:"";}}}}s:3:"url";s:46:"/properties/new-york/sale/440-west-22nd-street";s:13:"property_type";s:13:"Single Family";s:4:"sqft";s:4:"6700";s:13:"summary_intro";s:657:"Behind the most unique carved doors in Chelsea lies space and elegance rarely seen in Manhattan. Available for the first time in over 20 years, the Samuel Turner House offers a unique opportunity to own a magnificent and grand piece of New York history. Each floor of 1,675 gracious square feet is married to 14-foot, 12-foot and 10-foot high ceilings that capture the essence of grand living. Sharply etched acanthus leaf crown molding; one gorgeous marble fireplace after another; handmade 10 to 8-foot high doors; marquetry galore; enormous windows with their original shutters, are but a few of the treats found inside this immense 25-foot wide mansion.";s:12:"summary_full";s:2607:"<hr><p>Rebuilt with privacy and quiet in mind, this building is a calm oasis on Chelsea’s best block. West 22nd Street, which can only be entered by vehicles going north on 10th Avenue, boasts it’s own private park; a splendid mixture of early and late 19th century townhomes; plus rows of old-style gaslights. Among the many surprises – which can’t be seen – are extensive between floor soundproofing and a third pane of glass laminated into each and every front window. The open spaces on the east and west sides of the last 15 feet of this magnificent 67-foot long building are just waiting for a wall of windows.
</p><p>So step into 440 West 22nd Street where the elegance of a bygone era meets 21st century engineering, providing the ultimate in undisturbed tranquility. Enjoy your own four-season garden, and watch dozens of perennials bloom as the seasons and butterflies glide by.
</p><p>Set between Ninth and Tenth Avenues, in the heart of the famed Chelsea Seminary District, you are merely steps away from the trendy High Line Park and New York's chic art gallery district. Also nearby are the Chelsea Market; the Chelsea Piers sports complex; the new Hudson River Park; Youngwoo’s new SuperPier; and a wide variety of upscale restaurants and shops.
</p><p>Built in the Greek Revival style of 1835, this home is currently configured as six units that will be Delivered Vacant: two floor-through apartments on the Garden and Parlor levels, along with four free-market, one-bedroom apartments on the upper floors.</p>THE NUMBERS: <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;"><br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">* Building size - 25’ x 67' <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">* Lot size – 99’ deep<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">* 6,700 Sq. Ft. Interior<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">* 800 Sq. Ft. Garden<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">* Filed Plans for 825 Sq. Ft. Penthouse Addition<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;"><p>* 1,250 Sq. Ft. Cellar <br></p>";s:8:"featured";s:1:"1";s:4:"plot";s:14:"W25' x D98.75'";s:12:"key_features";a:4:{i:0;s:40:"825 Sq.Ft Penthouse addition in progress";i:1;s:6:"Garden";i:2;s:6:"Cellar";i:3;s:10:"Fireplaces";}s:17:"location_granular";s:31:"Between Ninth and Tenth Avenues";s:9:"datestamp";i:1440475200;s:7:"stories";s:1:"4";s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:1:{i:0;s:31:"/agents/garfield/matthew-lesser";}s:10:"build_date";s:5:" 1835";s:17:"openhouse_details";s:23:"Monday 8/31 1:30-3:00PM";s:8:"location";a:3:{s:4:"name";s:20:"440 West 22nd Street";s:8:"latitude";s:8:"40.74624";s:9:"longitude";s:9:"-74.00321";}s:8:"brochure";s:1:"/";s:11:"floor_plans";s:47:"/assets/downl