mp";i:1440648000;s:5:"price";s:8:"18300000";s:17:"property_location";s:15:"Upper East Side";s:17:"location_granular";s:33:"Between Fifth and Madison Avenues";s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:2:{i:0;s:29:"/agents/garfield/jed-garfield";i:1;s:32:"/agents/garfield/caylyn-sullivan";}s:13:"property_type";s:13:"Single-Family";s:4:"plot";s:16:"W20’ x D100’";s:7:"stories";s:1:"5";s:4:"sqft";s:4:"6500";s:12:"key_features";a:5:{i:0;s:8:"Elevator";i:1;s:6:"Garden";i:2;s:4:"HVAC";i:3;s:13:"Two entrances";i:4;s:10:"Fireplaces";}s:13:"summary_intro";s:395:"14 East 93rd Street is a wonderfully maintained single-family townhouse located on a beautiful tree lined block steps away from Fifth Avenue and Central Park. Built in 1892 by the architect Walter Reid Jr., this 20 foot wide home boasts five stories, 6,500 square feet of sun filled space with northern, southern and western exposures, grand ceiling heights and an elevator servicing all floors.";s:12:"summary_full";s:1276:"<p>Ground Floor
</p><p>The main entrance leads directly to the elevator and main staircase. A side hallway leads into the large, brightly lit, eat-in kitchen from which, one can access the serene south-facing garden. The secondary entrance opens to a mudroom, an ideal place for storing items prior to entering the rest of the house.
</p><p>Parlor Floor
</p><p>The perfect floor for entertaining. The living room in the rear is highlighted by floor to ceiling windows and a working fireplace, while the formal dining room in the front conveniently contains a butler’s kitchen with a discrete side stairwell that allows access to the downstairs kitchen.
</p><p>Third Floor
</p><p>The master suite. A peaceful front room that is ideal for a sitting room or home office. The master bedroom in back is quiet and receives southern and western light from windows on two sides of the room, a unique feature to this townhouse. This floor also has two full bathrooms, both adjoined by walk in closets.
</p><p> Fourth Floor
</p><p>Bedroom and bathroom in front. The spacious room in the rear makes an excellent playroom for children and is highlighted by three skylights that flood the room with light.
</p><p>Fifth Floor
</p><p>Two additional bedrooms each with a full bathroom.
</p>";s:13:"preview_image";s:55:"/assets/img/properties/sale/resized/14_East_93rd_V2.jpg";s:14:"photo_carousel";a:9:{i:0;s:55:"/assets/img/properties/sale/_NIK4886-20151117091903.jpg";i:1;s:40:"/assets/img/properties/sale/_NIK3486.jpg";i:2;s:40:"/assets/img/properties/sale/_NIK3470.jpg";i:3;s:40:"/assets/img/properties/sale/_NIK3479.jpg";i:4;s:40:"/assets/img/properties/sale/_NIK3437.jpg";i:5;s:40:"/assets/img/properties/sale/_NIK3446.jpg";i:6;s:40:"/assets/img/properties/sale/_NIK3406.jpg";i:7;s:55:"/assets/img/properties/sale/_NIK3377-20151117092131.jpg";i:8;s:40:"/assets/img/properties/sale/_NIK3365.jpg";}s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"40.785361";s:9:"longitude";s:9:"-73.95633";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:47:"/assets/downloads/floorplan1-20150929112002.jpg";s:10:"streeteasy";s:1:"1";s:17:"streeteasy_status";s:6:"active";s:2:"id";s:36:"69e4a0b9-db85-406c-8f5d-086a300373ce";s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:10:"2015-10-08";s:9:"startTime";s:8:"12:00 PM";s:7:"endTime";s:8:"01:00 PM";s:8:"apptOnly";s:0:"";}}s:9:"amenities";a:4:{i:0;s:10:"dishwasher";i:1;s:8:"elevator";i:2;s:9:"fireplace";i:3;s:5:"patio";}s:8:"zip_code";s:5:"10128";s:9:"ownership";s:9:"townhouse";s:5:"rooms";s:2:"23";s:8:"bedrooms";s:1:"5";s:9:"bathrooms";s:1:"6";s:6:"powder";s:1:"2";s:14:"street_address";s:19:"14 East 93rd Street";s:8:"currency";s:7:"dollars";s:7:"realtor";s:8:"garfield";s:5:"_file";s:120:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/1-new-york/sale/2015-08-27-14-east-93rd-street.md";s:11:"_local_path";s:63:"/1-properties/1-new-york/sale/2015-08-27-14-east-93rd-street.md";s:10:"_order_key";i:1440648000;s:13:"datetimestamp";N;s:4:"date";s:17:"August 27th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452031934;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:19:"14-east-93rd-street";s:7:"_folder";s:24:"properties/new-york/sale";s:9:"_basename";s:33:"2015-08-27-14-east-93rd-street.md";s:9:"_filename";s:30:"2015-08-27-14-east-93rd-street";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:9:"permalink";s:45:"/properties/new-york/sale/14-east-93rd-street";}}s:33:"2015-08-28-41-west-70th-street.md";a:5:{s:6:"folder";s:24:"properties/new-york/sale";s:4:"path";s:63:"/1-properties/1-new-york/sale/2015-08-28-41-west-70th-street.md";s:4:"file";s:33:"2015-08-28-41-west-70th-street.md";s:3:"url";s:45:"/properties/new-york/sale/41-west-70th-street";s:4:"data";a:56:{s:5:"title";s:19:"41 West 70th Street";s:9:"site_root";s:21:"http://104.131.23.73/";s:3:"url";s:45:"/properties/new-york/sale/41-west-70th-street";s:9:"datestamp";i:1440734400;s:5:"price";s:8:"17900000";s:17:"property_location";s:15:"Upper West Side";s:17:"location_granular";s:45:"Between Columbus Avenue and Central Park West";s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:2:{i:0;s:36:"/agents/garfield/richard-pretsfelder";i:1;s:26:"/agents/garfield/alex-yoel";}s:13:"property_type";s:13:"Single-Family";s:4:"plot";s:14:"W20' x D100’";s:7:"stories";s:1:"6";s:4:"sqft";s:4:"8000";s:8:"bedrooms";s:1:"6";s:5:"taxes";s:5:"31075";s:12:"key_features";a:5:{i:0;s:17:"Landscaped garden";i:1;s:23:"Winding steel staircase";i:2;s:8:"Elevator";i:3;s:12:"Laundry room";i:4;s:18:"White oak flooring";}s:13:"summary_intro";s:535:"Welcome to the Upper West Side's finest town home. Situated on the neighborhood's most desirable block, just steps from Central Park, 41 West 70th Street is the fifth in a series of eight beautiful single family homes. Originally designed by the architect Gilbert A. Schellinger in the Renaissance Revival style in 1891, the interior was completely demolished and and re-built into this modern classic. This is not a spec house, but was instead renovated by the current owners who spared no expense in creating a townhouse masterpiece.";s:12:"summary_full";s:6389:"<p>This private residence was built by an architect with a focus on maintaining light and flow on each floor. It has been meticulously constructed, with similar materials to those chosen by Olmstead & Vaux in their construction of Central Park: blue stone, pigmented stucco, almond tinted mortar, steel casement windows, limestone, clinker & roman brick, copper flashing. The original 120 year old structural beams were planed and woven back into the architecture. The home contains over 8,000 square feet of interior space, an elevator, six bedrooms, seven bathrooms, two full floors of entertaining space, a north and south windowed cellar that creates light and ventilation and is ideal for accommodating a media/play room and gym, a loggia adjacent to the grand living room that looks down upon a beautifully landscaped garden, and a large terrace off the fourth floor that looks out on the skyline that runs along Central Park West. In addition the property has extremely low taxes of $31,075. Experience the best of town house living in this magnificent single family home one half block away from Central Park.</p>Finishes Include:<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;"><br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- 20 feet wide, 8000+ square feet, five levels plus full height basement <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Fully restored facade with new stoop and adjacent planter to Landmark 1891 specifications<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Seven huge 7' x 7' steel casement fixed and operable windows<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Four wood-burning fireplaces <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Pre-wired for AV customization<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- All new windows with insulated glass<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Custom rift & quarter sawn white oak flooring <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Restored entryway with original ironwork front doors<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Custom steel staircase with elegant blackened iron winding railing from cellar to top floor<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Parlor floor loggia with custom wrought iron hand hewn railings <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Fourth floor terrace with irrigation system<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Landscaped garden with irrigation, drainage, specimen Japanese maple, 50' Chinese elm tree, high intensity Altima BBQ <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Landscaped front yard planter and adjacent trees with irrigation system<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Radiant heat throughout cellar, entire kitchen level, all bathrooms as well as both laundries <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- New custom elevator serving five floors<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Gracious 6 bedrooms, <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Duravit & Dornbracht fixtures and fittings throughout.<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- High end appliances (42" SubZero refrigerator, 6 burner Wolf stove, Bosch dishwasher, etc)<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Two custom glass 4' x 8' roof skylights<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Two laundry rooms located on the 4th floor and cellar<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Cellar excavated to provide full height ceilings and floors include radiant heat and full drainage system under slab in addition to sump pump.<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Cast iron Kohler tubs<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- All brick party walls were 100% re-pointed.<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Museum style wall construction designed for hanging art throughout<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Sound attenuation in walls and between floors<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">- Fully sprinklered<br st