:7:"stories";s:1:"5";s:4:"sqft";s:4:"6565";s:8:"bedrooms";s:1:"5";s:9:"bathrooms";s:1:"5";s:5:"taxes";s:5:"25740";s:12:"key_features";a:4:{i:0;s:17:"Historic district";i:1;s:10:"Fireplaces";i:2;s:8:"Elevator";i:3;s:6:"Garden";}s:13:"summary_intro";s:801:"Prior to its urbanization in the late 1800s, the Riverside Drive-West 80th-81st Street Historic Distric was part of a neighborhood known as Bloomingdale, in recollection of a flower-growing region of the same name near Haarlem, in Holland. In 1895-1900 the architect/owner Clarence True constructed several townhouse block fronts in the area and as such, True is considered largely responsible for development of the Drive. By the turn of the century, the area along Riverside Park had evolved into one of the most fashionable residential neighborhoods in the City. In 1899, one observer noted that West End Avenue “was one of the finest residential streets in New York City, while Riverside Drive was universally acknowledged to be one of the most beautiful and picturesque streets in the world.”";s:12:"summary_full";s:1090:"<p>320 West 80th Street was designed by True as one of eight attached townhomes built in the Elizabethan Renaissance Revival style. Consistent with True’s iconic design, the staircase is set in the center of the house. The stair placement allows for the major rooms to utilize the full width of the house, creating what is tantamount to three-room suites with two generous rooms in the front and rear. This historic house retains its impeccable original detail including eight original fireplaces and extensive use of original oak and mahogony paneling, pocket doors, floors, beams, and stairs. Containing over 6,500 square feet, this majestic 85’ deep home offers four to five bedrooms, two kitchens, a large dining room, a library, a family room, a sky-lit media room, an elevator, six-zone central air conditioning, and a tranquil south-facing garden. In close proximity to Riverside Park, an array of fine schools, Lincoln Center, and transportation and commerce on Broadway, 320 West 80th Street truly represents the finest in Upper West Side townhouse living.<span></span><br></p>";s:13:"preview_image";s:53:"/assets/img/properties/sale/resized/320_West_80th.jpg";s:14:"photo_carousel";a:10:{i:0;s:53:"/assets/img/properties/sale/large1-20150830173901.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20150830173908.jpg";i:2;s:53:"/assets/img/properties/sale/large3-20150830173914.jpg";i:3;s:53:"/assets/img/properties/sale/large4-20150830173921.jpg";i:4;s:53:"/assets/img/properties/sale/large5-20150830173936.jpg";i:5;s:53:"/assets/img/properties/sale/large6-20150830173943.jpg";i:6;s:53:"/assets/img/properties/sale/large7-20150830173949.jpg";i:7;s:53:"/assets/img/properties/sale/large8-20150830173956.jpg";i:8;s:53:"/assets/img/properties/sale/large9-20150830174002.jpg";i:9;s:54:"/assets/img/properties/sale/large10-20150830174007.jpg";}s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"40.785175";s:9:"longitude";s:10:"-73.981617";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:47:"/assets/downloads/floorplan1-20151102110541.jpg";s:10:"streeteasy";s:1:"1";s:17:"streeteasy_status";s:6:"active";s:2:"id";s:36:"a986802c-82c9-42d6-9f03-fd5f1a934dc0";s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:9:"amenities";a:3:{i:0;s:8:"elevator";i:1;s:9:"fireplace";i:2;s:5:"patio";}s:8:"zip_code";s:5:"10024";s:9:"ownership";s:9:"townhouse";s:5:"rooms";s:2:"18";s:6:"powder";s:1:"1";s:14:"street_address";s:21:"320 West 80th Street ";s:8:"currency";s:7:"dollars";s:7:"realtor";s:8:"garfield";s:5:"_file";s:121:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/1-new-york/sale/2015-08-30-320-west-80th-street.md";s:11:"_local_path";s:64:"/1-properties/1-new-york/sale/2015-08-30-320-west-80th-street.md";s:10:"_order_key";i:1440907200;s:13:"datetimes