pprovals have been completed. This property comes with all renovation plans and permits in place, approved by the Department of Buildings. This once in a lifetime opportunity is primed to install the home of your dreams.";s:12:"summary_full";s:1026:"<p>CUSTOMIZE: Your very own Turtle Bay townhouse without the aggravation: This 18'67" wide non landmarked home has approved plans from the NYC Department of Buildings for a new Single-family construction, including an additional 3,800 square feet of extensions, and two floors. A unique opportunity allows this property to be customized to meet the exact needs and wants of the new owner...built and delivered turnkey.
</p><p>LOCATION: 244 East 48th Street is located in the heart of Midtown Manhattan within walking distance of countless landmarks and attractions, well known Manhattan restaurants, corporate headquarters, world class shopping, various transportation options, and the UN.
</p><p>This property is also located in one of the most celebrated and historic townhouse rows in all of Manhattan. This remarkable area was once home to Bob Dylan, Audrey Hepburn, Irving Berlin, Kurt Vonnegut just to name a few. To this day well known musicians, producers, actors, and politicians continue to call this area home.
