17:"property_location";s:15:"Upper East Side";s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"40.784645";s:9:"longitude";s:10:"-73.955378";}s:17:"location_granular";s:32:"Between Park and Madison Avenues";s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:2:{i:0;s:29:"/agents/garfield/jed-garfield";i:1;s:32:"/agents/garfield/caylyn-sullivan";}s:13:"property_type";s:13:"Single-Family";s:10:"build_date";s:4:"1888";s:4:"plot";s:12:"W17' x D100'";s:7:"stories";s:1:"5";s:4:"sqft";s:6:"4,800 ";s:8:"bedrooms";s:1:"7";s:9:"bathrooms";s:1:"4";s:12:"key_features";a:5:{i:0;s:15:"Queen Ann-style";i:1;s:10:"Fireplaces";i:2;s:6:"Garden";i:3;s:15:"Maid's quarters";i:4;s:16:"Original Details";}s:13:"summary_intro";s:511:"Located just steps off of Madison Avenue on a tree-lined block in the heart of Carnegie Hill, 51 East 92nd Street represents an opportunity to purchase one of the two remaining rowhouses in a series of four built in 1888 to the designs of Frank Wennemer. Originally constructed as a Queen Anne Style townhouse, this home was altered in 1927 to the designs of Frederick R. King who incorporated many of his own details including, neo-Federal style windows and two beautifully arched openings on the garden level.";s:12:"summary_full";s:1167:"<p>The wonderful details of this five story, single-family townhouse extend beyond the facade into the home. The garden floor is highlighted by a large informal dining area, which is accompanied by an eat-in kitchen featuring a skylight and access to a lovely landscaped garden. The parlor floor is truly grand, boasting 12-ft ceilings in both the sun filled, south facing living room in the front, and the formal dining room in the rear. This formal dining room has been thoughtfully set up for entertaining with access to a wet bar and a back staircase that leads down into the kitchen. The third floor has space for a bedroom in the front, while the master suite, complete with a dressing area and full bathroom, occupies the rear. The fourth floor includes two bedrooms, a full bathroom and a laundry room; while the fifth floor features two bedrooms, an office, a walk in closet and a full bathroom. Separate maid’s quarters. Wood burning fireplaces and original detail throughout.
</p><p>Please note that this property is under a net lease that expires in early 2017. The purchaser will receive a steady income stream while planning their own renovation.
