features";a:6:{i:0;s:14:"Sutton Gardens";i:1;s:14:"Four Balconies";i:2;s:8:"Elevator";i:3;s:15:"Custom Millwork";i:4;s:15:"Wood Fireplaces";i:5;s:17:"Finished basement";}s:13:"summary_intro";s:488:"One of the 14 houses that comprise the illustrious, tree-lined Sutton Square, 13 Sutton Place, the Elisabeth Marbury House, is an exclusive single family masterpiece. Built in 1875, this six floor, 4,800 usable square foot townhouse was remodeled in 1920 by renowned interior decorator Elsie de Wolfe and architect Mott Schmidt. Today, 13 Sutton Place retains many details from its storied history, including four marble fireplaces, wainscoting, crown moldings, and wrought iron railings.";s:12:"summary_full";s:1047:"<p dir="ltr" rel="line-height:1.38;margin-top:0pt;margin-bottom:0pt;">This renowned townhome enjoys access to this one of a kind, picturesque semi-private garden shared only by residents of the Sutton Place Enclave. This garden is a sweeping oasis of greenery set adjacent to the East River with a classic view of the Ed Koch Bridge. From the rear of 13 Sutton Place, this scenery creates a stunning vista of the Sutton Square Garden leading into the the sun-drenched waters of the River. 13 Sutton Place features 4 bedrooms, 5 bathrooms, 3 powder rooms, an elevator, a garden patio, a rooftop terrace, 3 balconies, and a finished basement with separate staff quarters and kitchenette.
</p>Sutton Square is one of the most exclusive enclaves in all of New York City. Consisting of 14 detail-laden townhouses, this neighborhood offers unmatched privacy and seclusion, yet is conveniently located moments from the heart of Midtown Manhattan. 13 Sutton Place offers a discerning individual an opportunity to own a true piece of New York City history.";s:13:"preview_image";s:63:"/assets/img/properties/sale/resized/_NIK0895-20151228200044.jpg";s:14:"photo_carousel";a:17:{i:0;s:53:"/assets/img/properties/sale/Large1-20150928165720.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20150910132512.jpg";i:2;s:53:"/assets/img/properties/sale/large4-20150910132512.jpg";i:3;s:53:"/assets/img/properties/sale/large5-20150910132512.jpg";i:4;s:53:"/assets/img/properties/sale/large6-20150910132513.jpg";i:5;s:53:"/assets/img/properties/sale/large7-20150910132513.jpg";i:6;s:53:"/assets/img/properties/sale/large8-20150910132513.jpg";i:7;s:53:"/assets/img/properties/sale/large9-20150910132513.jpg";i:8;s:53:"/assets/img/properties/sale/large3-20150910132512.jpg";i:9;s:54:"/assets/img/properties/sale/large10-20150910132514.jpg";i:10;s:54:"/assets/img/properties/sale/large11-20150910132514.jpg";i:11;s:54:"/assets/img/properties/sale/large12-20150910132514.jpg";i:12;s:54:"/assets/img/properties/sale/large13-20150910132514.jpg";i:13;s:54:"/assets/img/properties/sale/large14-20150910132514.jpg";i:14;s:54:"/assets/img/properties/sale/large15-20150910132514.jpg";i:15;s:39:"/assets/img/properties/sale/large16.jpg";i:16;s:39:"/assets/img/properties/sale/large17.jpg";}s:5:"taxes";s:5:"44020";s:8:"brochure";N;s:11:"floor_plans";a:1:{i:0;s:52:"/assets/downloads/13 Sutton Place Floorplan JPEG.jpg";}s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:17:"streeteasy_status";s:6:"active";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:10:"2015-12-17";s:9:"startTime";s:8:"11:30 AM";s:7:"endTime";s:8:"01:00 PM";s:8:"apptOnly";s:0:"";}}s:10:"streeteasy";s:1:"1";s:2:"id";s:36:"502afc78-ddee-431d-8b