startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:4:{i:0;s:31:"/agents/garfield/matthew-lesser";i:1;s:28:"/agents/garfield/ravi-kantha";i:2;s:31:"/agents/garfield/matthew-pravda";i:3;s:37:"/agents/garfield/christopher-l-riccio";}s:13:"property_type";s:13:"Single-Family";s:7:"stories";s:3:"5.5";s:4:"sqft";s:4:"4500";s:8:"bedrooms";s:1:"4";s:9:"bathrooms";s:1:"6";s:5:"taxes";s:5:"59128";s:12:"key_features";a:6:{i:0;s:8:"Elevator";i:1;s:9:"Roof deck";i:2;s:6:"Garden";i:3;s:19:"Crestron Smart Home";i:4;s:29:"Subzero/Miele/Wolf appliances";i:5;s:20:"Radiant Heated Stoop";}s:13:"summary_intro";s:591:"Set on a tree-lined oasis in the highly desirable West Village, 41 Charles Street is a pristine, single-family home available for the first time since its comprehensive, multi-year gut renovation and expansion. In mint condition, this approximately 4,500 square foot Italianate brownstone has emerged as a turnkey, luxury, single-family home with first class finishes, elevator, radiant heated front stoop, full house Crestron smart home, a penthouse addition, and multiple indoor and outdoor living spaces including a large rear garden, two Juliette balconies, and a south-facing roof deck.";s:12:"summary_full";s:1919:"<p>Designed by architect Mark Zeff with luxury living and entertaining in mind, the classic contemporary aesthetic of 41 Charles, cultivated on 5.5 levels, includes neutral colors, pickled white-oak floors, full height custom steel casement windows and rear doors, a limestone paved 40’-deep rear garden, travertine slab and radiant heated floors in bathrooms, Waterworks fixtures throughout, an eat-in custom chef’s Leicht kitchen, powered by Subzero, Miele, and Wolf appliances, with picturesque views of the limestone paved read garden and waterfall slab gold Calacatta island, counters, and backsplash.<br></p><p>With generous ceiling heights and abundant natural sunlight, this home is open and airy. The double parlor floor features a large living space focused around the original gas-fired marble mantled fireplace, a sitting area and formal dining room in rear with wet-bar and full height doors opening to a Juliet balcony.<br></p><p>The full-floor master suite is complete with expansive outfitted dressing closets, full height French doors, and a luxurious three-windowed bathroom covered in limestone with Waterworks fixtures, heated floors, oversized shower with a free-standing bench, and a free-standing marble soaking tub.<br></p><p>The penthouse expansion features a wall of full height casement doors facing south with unobstructed views over the low-rise landmarked townhouses. This luxurious space can be used as an additional bedroom with full bathroom or a picturesque den/home office. At the lowest level, the finished basement with window wells and full bathroom is ideal for a media room, gym, recreation space, and/or staff quarters.<br></p><p>Never lived in before, 41 Charles is a unique opportunity for the most discerning of purchasers to enjoy the rare experience of living in a brand new townhome in one of the most exclusive and sought after neighborhoods in New York City.<br></p>";s:13:"preview_image";s:63:"/assets/img/properties/sale/resized/_NIK2884-20151228194700.jpg";s:14:"photo_carousel";a:18:{i:0;s:42:"/assets/img/properties/sale/_NIK2884-2.jpg";i:1;s:40:"/assets/img/properties/sale/_NIK1093.jpg";i:2;s:40:"/assets/img/properties/sale/_NIK1561.jpg";i:3;s:40:"/assets/img/properties/sale/_NIK1579.jpg";i:4;s:40:"/assets/img/properties/sale/_NIK1584.jpg";i:5;s:40:"/assets/img/properties/sale/_NIK1271.jpg";i:6;s:40:"/assets/img/properties/sale/_NIK1078.jpg";i:7;s:40:"/assets/img/properties/sale/_NIK1600.jpg";i:8;s:40:"/assets/img/properties/sale/_NIK1684.jpg";i:9;s:40:"/assets/img/properties/sale/_NIK1342.jpg";i:10;s:40:"/assets/img/properties/sale/_NIK1703.jpg";i:11;s:40:"/assets/img/properties/sale/_NIK1103.jpg";i:12;s:40:"/assets/img/properties/