"price";s:7:"6500000";s:17:"property_location";s:17:"Greenwich Village";s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"40.730121";s:9:"longitude";s:10:"-74.001007";}s:17:"location_granular";s:29:"On the Corner of Minetta Lane";s:17:"streeteasy_status";s:6:"active";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:2:{i:0;s:37:"/agents/garfield/christopher-l-riccio";i:1;s:31:"/agents/garfield/matthew-pravda";}s:13:"property_type";s:13:"Single-Family";s:4:"plot";s:15:"W19.9' x D47.8'";s:13:"building_size";s:15:"W19.9' x D35.5'";s:7:"stories";s:1:"4";s:8:"bedrooms";s:1:"4";s:9:"bathrooms";s:1:"3";s:12:"key_features";a:3:{i:0;s:16:"Original details";i:1;s:10:"Fireplaces";i:2;s:36:"National Register of Historic Places";}s:13:"summary_intro";s:253:"5 Minetta Lane aka 19 Minetta Street is one of four remaining 1840s mews houses converted in the 1920s by Village developer Vincent Pepe, who envisioned “the Minettas” as “studios for the artist, the writer, the creator of beauty in any medium.”";s:12:"summary_full";s:598:"<p>In 1926, House Beautiful found the mews enchanting, with “a comforting charm which you would not exchange for Long Island, New Jersey or all of Murray Hill.”<br></p><p>The beautiful corner townhouse measures 19'9""x 35'5"", has gated entrances on two sides and features 26 windows on three exposures streaming sunlight from north, south and west. There is a large kitchen hearth and an additional 7 fireplaces. The original wood banisters are also preserved throughout the house, which is listed on the National Register of Historic Places.<br></p><p>A true piece of Village history!<br></p>";s:13:"preview_image";s:49:"/assets/img/properties/sale/resized/5_Minetta.jpg";s:14:"photo_carousel";a:9:{i:0;s:53:"/assets/img/properties/sale/large1-20151005104350.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20151005104350.