k/sale/312-east-52nd-street";s:2:"id";s:36:"fbfdf3bf-d2e4-4173-89ec-18cdafff3464";s:9:"datestamp";i:1445918400;s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:8:"zip_code";s:5:"10022";s:5:"price";s:7:"6195000";s:17:"property_location";s:12:"Midtown East";s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"40.755619";s:9:"longitude";s:10:"-73.966999";}s:17:"location_granular";s:32:"Between First and Second Avenues";s:17:"streeteasy_status";s:6:"active";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:2:{i:0;s:26:"/agents/garfield/dane-hope";i:1;s:29:"/agents/garfield/jed-garfield";}s:13:"property_type";s:9:"Townhouse";s:9:"ownership";s:9:"townhouse";s:4:"plot";s:12:"W19' x D100'";s:13:"building_size";s:11:"W19' x D60'";s:10:"build_date";s:4:"1910";s:7:"stories";s:1:"4";s:4:"sqft";s:4:"4600";s:5:"units";s:1:"2";s:8:"bedrooms";s:1:"5";s:9:"bathrooms";s:1:"4";s:9:"amenities";a:7:{i:0;s:6:"prewar";i:1;s:7:"balcony";i:2;s:10:"dishwasher";i:3;s:9:"fireplace";i:4;s:5:"patio";i:5;s:7:"storage";i:6;s:11:"washerDryer";}s:12:"key_features";a:5:{i:0;s:9:"Renovated";i:1;s:12:"Washer/dryer";i:2;s:6:"Garage";i:3;s:10:"Fireplaces";i:4;s:7:"Terrace";}s:13:"summary_intro";s:320:"Just steps off Manhattan’s elegant Sutton Place South, 312 East 52nd Street is ideally situated on a quiet and graceful tree lined street. Built in 1910, this 19’ wide approximate 4,600 sq.ft four-story home with additional air rights has been newly restored and renovated into two generously proportioned duplexes. ";s:12:"summary_full";s:1348:"<p>The garden level and second floor of the lower duplex each have a 17’-deep extension. The lower duplex is entered from street level and has an open layout, which includes a renovated kitchen, dining area, full bathroom and living room with a wood-burning fireplace. The large formal dining room and family room lead out onto a lovely landscaped south-facing garden. The full basement contains all new mechanicals, a full sized washer/dryer and spacious storage. The second floor of the duplex contains a master bedroom with a wood burning fireplace, a full bath, and additional bedroom.
</p><p>The upper duplex has been renovated with modern ideals, incorporating sensibly designed storage. The first floor of the upper duplex features a living room, full bathroom, open kitchen and dining area, which open directly onto a south facing large terrace ideal for outdoor dining. The top floor has a sun-flooded master bedroom with skylights and a 15' ceiling, a full bath, a second large bedroom and a washer/dryer. This 19’-wide townhouse, which has three windows across the front and rear facades, is surrounded by low buildings to the north and south and has abundant light all day. Perfectly located in Midtown, the townhouse is conveniently situated next to shopping, restaurants, parks, the East River esplanade, and mass transit.<br></p>";s:13:"preview_image";s:53:"/assets/img/properties/sale/resized/312_East_52nd.jpg";s:14:"photo_carousel";a:8:{i:0;s:53:"/assets/img/properties/sale/large1-20151027153355.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20151027153355.jpg";i:2;s:53:"/assets/img/properties/sale/large3-20151027153355.jpg";i:3;s:53:"/assets/img/properties/sale/large4-20151027153355.jpg";i:4;s:53:"/assets/img/properties/sale/large5-20151027153356.jpg";i:5;s:53:"/assets/img/properties/sale/large6-20151027153356.jpg";i:6;s:53:"/assets/img/properties/sale/large7-20151027153357.jpg";i:7;s:53:"/assets/img/properties/sale/large8-20151027153357.jpg";}s:11:"floor_plans";s:28:"/assets/downloads/large9.jpg";s:5:"rooms";s:2:"15";s:14:"street_address";s:20:"312 East 52nd Street";s:8:"currency";s:7:"dollars";s:7:"realtor";s:8:"garfield";s:10:"streeteasy";s:1:"1";s:8:"brochure";s:0:"";s:5:"_file";s:121:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/1-new-york/sale/2015-10-27-312-east-52nd-street.md";s:11:"_local_path";s:64:"/1-properties/1-new-york/sale/2015-10-27-312-east-52nd-street.md";s:10:"_order_key";i:1445918400;s:13:"datetimestamp";N;s:4:"date";s:18:"October 27th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:145203