l";s:57:"/properties/new-york/sale/440-west-22nd-street-maisonette";s:2:"id";s:36:"b530aced-0dd7-4d0a-afa9-28c688f9313d";s:9:"datestamp";i:1447909200;s:15:"streeteasy_type";s:4:"sale";s:14:"street_address";s:20:"440 West 22nd Street";s:9:"apartment";s:10:"Maisonette";s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:8:"zip_code";s:5:"10011";s:8:"currency";s:7:"dollars";s:7:"realtor";s:8:"garfield";s:5:"price";s:7:"8350000";s:17:"property_location";s:7:"Chelsea";s:8:"location";a:3:{s:4:"name";s:34:"440 West 22nd Street, New York, NY";s:8:"latitude";s:8:"40.74624";s:9:"longitude";s:9:"-74.00321";}s:17:"location_granular";s:31:"Between Ninth Ave and Tenth Ave";s:17:"streeteasy_status";s:6:"active";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:10:"2015-12-15";s:9:"startTime";s:8:"12:00 PM";s:7:"endTime";s:8:"01:00 PM";s:8:"apptOnly";s:0:"";}}s:6:"agents";a:1:{i:0;s:31:"/agents/garfield/matthew-lesser";}s:13:"property_type";s:9:"Townhouse";s:9:"ownership";s:5:"condo";s:4:"sqft";s:4:"3350";s:5:"rooms";s:1:"6";s:8:"bedrooms";s:1:"3";s:9:"bathrooms";s:1:"3";s:9:"amenities";a:6:{i:0;s:6:"prewar";i:1;s:10:"dishwasher";i:2;s:9:"fireplace";i:3;s:5:"patio";i:4;s:4:"pets";i:5;s:11:"washerDryer";}s:12:"key_features";a:6:{i:0;s:12:"13' Ceilings";i:1;s:12:"10 Pilasters";i:2;s:22:"Acanthus Leaf Moldings";i:3;s:12:"Washer/dryer";i:4;s:23:"30'-Deep Private Garden";i:5;s:26:"3 Marble Mantle Fireplaces";}s:13:"summary_intro";s:481:"GARDEN & PARLOR MAISONETTE 

Behind the most unique carved doors in Chelsea lies space and elegance rarely seen in Manhattan. Imagine an exquisitely rebuilt Grand Parlor with 14 pilasters, each 10 feet high; 13-foot ceilings; sharply etched acanthus leaf crown molding; two gorgeous marble fireplaces; handmade 10 to 8-foot high doors; marquetry galore; enormous windows with their original shutters; and you will have a sense of this rarely seen or photographed 1835 historic gem.";s:12:"summary_full";s:2402:"<p>Considered Chelsea’s original grand mansion, each floor is 1,675 square feet; this superb building was rebuilt with privacy and quiet in mind. The current owner spared no expense, used the best craftsmen and superior materials to turn this building into a calm oasis. Long acknowledged as Chelsea’s best block, West 22nd Street, which can only be entered by vehicles going north on 10th Avenue, boasts it’s own private park; a splendid mixture of early and late 19th century townhomes; plus rows of old-style gaslights. Among this mansion's many surprises – which can’t be seen – are extensive (between floor) sound proofing; a third pane of glass that is laminated into each and every front window; plus the open space on the east and west sides of the last 15 feet of this magnificent 67-foot long building that is just waiting for a wall of windows to be installed...<br><br>So step into 440 West 22nd Street where the elegance of a bygone era meets 21st century engineering, providing the ultimate in undisturbed quiet and privacy. This potential duplex is the real thing: a true Maisonette, a house within a house. Use the under-the-stoop entrance, which enters directly into the Garden Level, boasting enormous bedrooms; marble baths; plus a charming 31-foot long living room that looks out onto an exquisitely curated garden. Or use the up-the-stoop entrance that enters into the grand spaces of the Parlor level. Either way you’ll enjoy your own four-season garden, and watch dozens of perennials bloom as the seasons and the butterflies glide by.<br><br>Set between Ninth and Tenth Avenues, in the heart of the famed Chelsea Seminary District, you are merely steps away from the trendy High Line Park and New York's chic art gallery district. Also nearby are the Chelsea Market; the Chelsea Piers sports complex; the new Hudson River Park; Youngwoo’s new SuperPier; and a wide variety of upscale restaurants and shops. Yet, West 22nd Street remains untouched, graced with remarkably low traffic — it’s a quiet isle with an unusually small population that frequently forgets to lock their doors. <br><br>THE FACTS<br><br>* 25’ x 67’ On Two Levels  <br>* 3,350 Sq. Ft. Interior<br>* 800 Sq. Ft. Private Garden<br>* Shared 1,250 Sq. Ft. Cellar <br>* Building Is A Condo<br>* Washer/Dryer<br>* 3 Bedrooms<br>* 3 Bathrooms<br>* Dishwasher<br>* Hot Tub<br>* Smoke-Free</p>";s:13:"preview_image";s:53:"/assets/img/properties/sale/large1-20151119180158.jpg";s:14:"photo_carousel";a:19:{i:0;s:53:"/assets/img/properties/sale/large1-20151119180205.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20151119180205.jpg";i:2;s:53:"/assets/img/properties/sale/large3-20151119180206.jpg";i:3;s:53:"/assets/img/properties/sale/large4-20151119180206.jpg";i:4;s:53:"/assets/img/properties/sale/large5-20151119180206.jpg";i:5;s:53:"/assets/img/properties/sale/large6-20151119180206.jpg";i:6;s:53:"/assets/img/properties/sale/large7-20151119180251.jpg";i:7;s:53:"/assets/img/properties/sale/large8-20151119180207.jpg";i:8;s:53:"/assets/img/properties/sale/large9-20151119180207.jpg";i:9;s:54:"/assets/img/properties/sale/large10-20151119180207.jpg";i:10;s:54:"/assets/img/properties/sale/large11-20151119180406.jpg";i:11;s:54:"/assets/img/properties/sale/large12-20151119180432.jpg";i:12;s:54:"/assets/img/properties/sale/large13-20151119180208.jpg";i:13;s:54:"/assets/img/properties/sale/large14-20151119180208.jpg";i:14;s:54:"/assets/img/properties/sale/large15-20151119180209.jpg";i:15;s:54:"/assets/img/properties/sale/lar