ccupants. Luxurious master bath is ensuite and is beautifully redone. Master bath is complete with custom Jacuzzi bath and marble shower. <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;"><br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">Home has central air conditioning, high ceilings, two dishwashers, a washer/dryer, and abundant storage space. In addition, there is a storage room in the main building as well as a bike rack. <br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;"><br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;">Astor Terrace:<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; line-height: 20px;"><p>An award winning full service condominium building built in 1985 which includes a full time concierge and doorman, on site garage, a new gym, a live-in building manager, storage facility, and access to a private outdoor park which is accessed through the main building. </p><p><br></p>";s:13:"preview_image";s:53:"/assets/img/properties/sale/resized/233_East_93rd.jpg";s:14:"photo_carousel";a:13:{i:0;s:55:"/assets/img/properties/sale/_NIK4593-20151123113803.jpg";i:1;s:40:"/assets/img/properties/sale/_NIK4588.jpg";i:2;s:40:"/assets/img/properties/sale/_NIK4473.jpg";i:3;s:40:"/assets/img/properties/sale/_NIK4504.jpg";i:4;s:40:"/assets/img/properties/sale/_NIK4515.jpg";i:5;s:40:"/assets/img/properties/sale/_NIK4487.jpg";i:6;s:40:"/assets/img/properties/sale/_NIK4519.jpg";i:7;s:40:"/assets/img/properties/sale/_NIK4523.jpg";i:8;s:40:"/assets/img/properties/sale/_NIK4574.jpg";i:9;s:40:"/assets/img/properties/sale/_NIK4526.jpg";i:10;s:40:"/assets/img/properties/sale/_NIK4535.jpg";i:11;s:40:"/assets/img/properties/sale/_NI