13152.jpg";}s:15:"streeteasy_type";s:4:"sale";s:6:"agents";a:2:{i:0;s:29:"/agents/garfield/jed-garfield";i:1;s:32:"/agents/garfield/caylyn-sullivan";}s:13:"property_type";s:13:"Single-Family";s:12:"key_features";a:3:{i:0;s:23:"Original carriage house";i:1;s:16:"Neo-Grec details";i:2;s:16:"Landmarked block";}s:11:"maintenance";s:4:"1700";s:13:"summary_intro";s:416:"174 East 73rd street presents an extraordinary opportunity to own a rare, three story carriage house located on the landmarked block of East 73rd Street between Lexington and Third Avenues. This block, which has been noted by the New York Times as “one of the most distinctive in New York”, is replete with low rise carriage houses which were originally used by the most wealthy residents of the Upper East Side.";s:12:"summary_full";s:764:"<p>Today, these prized houses are highly sought after for their unique build and fascinating history. Built in 1889 to architectural designs by Frank Wennemer, 174 boasts an attractive Romanesque Revival style brick façade with a rock-faced limestone base, embellished with Neo-Grec details. The elegance of the façade is enhanced by an arched, grand center entrance, as well as an additional pedestrian side entrance. The building's interior layout is spacious and features impressive ceiling heights. These architectural details, the building's rich history and additional air rights make 174 an excellent house for a purchaser looking to create an original single family home. Currently configured as ground floor offices and an upper residential duplex.
</p>";s:5:"specs";s:53:"/assets/downloads/Properties_Individual_ALL_Clean.pdf";s:3:"url";s:46:"/properties/new-york/sale/174-east-73rd-street";s:9:"datestamp";i:1449810000;s:4:"plot";s:12:"W25' x D102'";s:7:"stories";s:1:"3";s:4:"sqft";s:4:"5475";s:10:"build_date";s:4:"1889";s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"40.770577";s:9:"longitude";s:10:"-73.960974";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:47:"/assets/downloads/floorplan1-20150928160121.jpg";s:17:"streeteasy_status";s:4:"sold";s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:9:"amenities";b:0;s:2:"id";s:36:"13a21f70-a077-485f-a1ae-585c8783395b";s:8:"zip_code";s:5:"10021";s:9:"ownership";s:9:"townhouse";s:5:"rooms";s:2:"14";s:8:"bedrooms";s:1:"4";s:9:"bathrooms";s:1:"4";s:14:"street_address";s:20:"174 East 73rd Street";s:8:"currency";s:7:"dollars";s:7:"realtor";s:8:"garfield";s:5:"_file";s:121:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/1-new-york/sale/2015-12-11-174-east-73rd-street.md";s:11:"_local_path";s:64:"/1-properties/1-new-york/sale/2015-12-11-174-east-73rd-street.md";s:10:"_order_key";i:1449810000;s:13:"datetimestamp";N;s:4:"date";s:19:"December 11th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452031947;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:20:"174-east-73rd-street";s:7:"_folder";s:24:"properties/new-york/sale";s:9:"_basename";s:34:"2015-12-11-174-east-73rd-street.md";s:9:"_filename";s:31:"2015-12-11-174-east-73rd-street";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:9:"permalink";s:46:"/properties/new-york/sale/174-east-73rd-street";}}s:33:"2015-12-28-142-east-end-avenue.md";a:5:{s:6:"folder";s:24:"properties/new-york/sale";s:4:"path";s:63:"/1-properties/1-new-york/sale/2015-12-28-142-east-end-avenue.md";s:4:"file";s:33:"2015-12-28-142-east-end-avenue.md";s:3:"url";s:45:"/properties/new-york/sale/142-east-end-avenue";s:4:"data";a:55:{s:5:"title";s:19:"142 East End Avenue";s:3:"url";s:45:"/properties/new-york/sale/142-east-end-avenue";s:2:"id";s:36:"9646b72d-8d37-4b66-8148-6c2237184c8c";s:9:"datestamp";i:1451278800;s:7:"realtor";s:8:"garfield";s:15:"streeteasy_type";s:4:"sale";s:14:"street_address";s:19:"142 East End Avenue";s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:8:"zip_code";s:5:"10028";s:8:"currency";s:7:"dollars";s:5:"price";s:7:"7500000";s:8:"location";a:3:{s:4:"name";s:33:"142 East End Avenue, New York, NY";s:8:"latitude";s:8:"40.77529";s:9:"longitude";s:9:"-73.94478";}s:17:"location_granular";s:39:"Between East 86th and East 87th Streets";s:17:"streeteasy_status";s:6:"active";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:9:"ownership";s:9:"townhouse";s:10:"build_date";s:4:"1899";s:7:"stories";s:1:"5";s:5:"rooms";s:2:"17";s:8:"bedrooms";s:1:"5";s:9:"bathrooms";s:1:"6";s:5:"taxes";s:5:"42864";s:9:"amenities";a:6:{i:0;s:7:"balcony";i:1;s:9:"fireplace";i:2;s:5:"patio";i:3;s:4:"pets";i:4;s:7:"storage";i:5;s:11:"washerDryer";}s:12:"key_features";a:6:{i:0;s:39:"Newly Renovated Single-Family Townhouse";i:1;s:12:"Washer/dryer";i:2;s:9:"Roof deck";i:3;s:10:"Dumbwaiter";i:4;s:23:"Unobstructed Park Views";i:5;s:21:"Custom Chef's kitchen";}s:13:"summary_intro";s:303:"142 East End Avenue is a completely gut-renovated single-family townhouse in the Henderson Place Historic District, a picturesque, tree-lined block of Victorian-style homes. Originally built in 1899, this Landmarked home still displays the original masonry detailing on its fully restore brick façade. ";s:12:"summary_full";s:1888:"<p>At approximately 4,000 square feet, sunlight floods every floor of living space, flowing into the house from the oversized windows and skylight above the staircase. There are five bedrooms, including a full floor master suite, and four marble baths with two additional powder rooms. Each room has electronic shades above large windows, and the entire home utilizes a smart system video intercom. The Garden Floor features Italian tile flooring and hardwood Brazilian teak is installed throughout the rest of the home, complimenting the stainless steel staircase with walnut finishes. 142 East End Avenue also boasts four private outdoor spaces: a barbecue patio and a dining terrace in the rear and a fifth floor patio and wood-decked roof with outdoor kitchenette in the front, which gaze down upon Carl Schurz Park, Gracie Mansion, and the East River.<br><br>142 East End Avenue features countless luxury details, including an eat-in chef's kitchen with black granite countertops, high-end stainless steel appliances, custom cabinetry, wine storage, and a dumbwaiter to serve the dining room above. Additionally, this spacious townhouse offers a grand Parlor Entry leading into a loft-like sitting room and dining room, a secondary kitchen adjacent to the dining room, radiant heated bathroom floors, and two gas fireplaces. The stately full-floor master suite features an office/den, a walk-through dressing area with built-in shelving, and a master bath with contemporary marble finishes, a glass shower stall, a soaking tub, water closet, and double vanity.<br><br>In the heart of one of the most beautiful and tranquil neighborhoods in all of New York City, perched upon Carl Schurz Park, Gracie Mansion, and the East River, and only minutes from Midtown Manhattan, 142 East End Avenue is a rare opportunity to purchase a pristinely renovated townhome on the Upper East Side.</p>";s:13:"preview_image";s:63:"/assets/img/properties/sale/DSC_0817_cropped-20151230073711.jpg";s:14:"photo_carousel";a:23:{i:0;s:50:"/assets/img/properties/sale/DSC_0817_cropped-2.jpg";i:1;s:40:"/assets/img/properties/sale/DSC_0624.jpg";i:2;s:40:"/assets/img/properties/sale/DSC_0607.jpg";i:3;s:55:"/assets/img/properties/sale/DSC_0644-20151229082158.jpg";i:4;s:40:"/assets/img/