s accessed via a grand curved wood staircase with ornamental wrought iron balustrade. There is access to the private garden through both the rear of the first floor dining room and garden level. The house features five wood burning fireplaces, six bedrooms, three full bathrooms and three half baths. Ideal for a private home, investor or government consulate.";s:13:"preview_image";s:46:"/assets/img/properties/sale/109_E35_Street.jpg";s:14:"photo_carousel";a:5:{i:0;s:53:"/assets/img/properties/sale/large1-20150928165832.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20150910143259.jpg";i:2;s:53:"/assets/img/properties/sale/large3-20150910143259.jpg";i:3;s:53:"/assets/img/properties/sale/large4-20150910143300.jpg";i:4;s:53:"/assets/img/properties/sale/large5-20150910143300.jpg";}s:6:"powder";s:1:"3";s:8:"brochure";s:0:"";s:11:"floor_plans";s:47:"/assets/downloads/floorplan1-20150928165836.jpg";s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:17:"streeteasy_status";s:4:"sold";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:10:"streeteasy";s:1:"1";s:2:"id";s:36:"dbd0654f-70a6-4348-9b4b-bcabaa9f8382";s:9:"amenities";a:6:{i:0;s:6:"prewar";i:1;s:7:"balcony";i:2;s:10:"dishwasher";i:3;s:9:"fireplace";i:4;s:5:"patio";i:5;s:11:"washerDryer";}s:8:"zip_code";s:5:"10016";s:9:"ownership";s:9:"townhouse";s:5:"rooms";s:2:"16";s:14:"street_address";s:20:"109 East 35th Street";s:8:"currency";s:7:"dollars";s:7:"realtor";s:8:"garfield";s:5:"_file";s:121:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/1-new-york/sale/2016-01-04-109-east-35th-street.md";s:11:"_local_path";s:64:"/1-properties/1-new-york/sale/2016-01-04-109-east-35th-street.md";s:10:"_order_key";i:1451883600;s:13:"datetimestamp";N;s:4:"date";s:17:"January 4th, 2016";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452031949;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:20:"109-east-35th-street";