ly 20 foot-wide 7,365 square foot townhouse sits awaiting a multitude of possibilities.  Opportunity exists to restore into a magnificent single family home, create an owner's duplex or triplex while keeping some income potential, or restore it as is.  Due to additional FAR that is intact and the fact that this is not a landmarked building, the potential to develop and restore are limitless.";s:13:"preview_image";s:70:"/assets/img/properties/sale/50_E81stStreet_Extras-1-20160105104111.jpg";s:14:"photo_carousel";a:13:{i:0;s:70:"/assets/img/properties/sale/50_E81stStreet_Extras-1-20160104100453.jpg";i:1;s:72:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-1.jpg";i:2;s:72:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-2.jpg";i:3;s:72:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-3.jpg";i:4;s:72:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-5.jpg";i:5;s:72:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-6.jpg";i:6;s:72:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-8.jpg";i:7;s:73:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-10.jpg";i:8;s:73:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-11.jpg";i:9;s:62:"/assets/img/properties/sale/50_E81stStreet_Extras_LowRes-4.jpg";i:10;s:62:"/assets/img/properties/sale/50_E81stStreet_Extras_LowRes-2.jpg";i:11;s:72:"/assets/img/properties/sale/50_E81stStreet_LydiaRosengarten_LowRes-7.jpg";i:12;s:62:"/assets/img/properties/sale/50_E81stStreet_Extras_LowRes-5.jpg";}s:8:"brochure";s:0:"";s:11:"floor_plans";a:1:{i:0;s:38:"/assets/downloads/WEB_50E81stSt_TH.jpg";}s:8:"location";a:3:{s:4:"name";s:33:"50 East 81st Street, New York, NY";s:8:"latitude";s:8:"40.77708";s:9:"longitude";s:9:"-73.96037";}s:12:"summary_full";s:822:"<p>Currently configured as a vacant ground floor doctor's office  plus eight apartments above.  The medical office is roughly 1,700 square feet and has access to a charming south facing garden.  This unit can be accessed either from the main building or from a separate side entrance.   Above there are 8 apartments, two units per floor, all of which have high ceilings, period details, ornate mantelpieces, and oversized windows.  Six of the eight apartments are vacant.  There are two remaining occupied RS apartments. Beautiful south facing exposure looking out onto low rise townhouses. There is a full cellar level below with ample ceiling height. In addition, there is a full set of stairs from the fifth floor that lead up to a large, flat roof.  Building is being sold as is. Oil heated. Zoned R8B.<br><br><br></p>";s:10:"build_date";s:4:"1921";s:10:"streeteasy";s:1:"1";s:5:"_file";s:120:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/1-new-york/sale/2016-01-04-50-east-81st-street.md";s:11:"_local_path";s:63:"/1-properties/1-new-york/sale/2016-01-04-50-east-81st-street.md";s:10:"_order_key";i:1451883600;s:13:"datetimestamp";N;s:4:"date";s:17:"January 4th, 2016";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452032114;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:19:"50-east-81st-street";s:7:"_folder";s:24:"properties/new-york/sale";s:9:"_basename";s:33:"2016-01-04-50-east-81st-street.md";s:9:"_filename";s:30:"2016-01-04-50-east-81st-street";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:9:"permalink";s:45:"/properties/new-york/sale/50-east-81st-street";}}s:34:"2015-10-05-131-east-92nd-street.md";a:5:{s:6:"folder";s:24:"properties/new-york/sale";s:4:"path";s:65:"/1-properties/1-new-york/sale/_2015-10-05-131-east-92nd-street.md";s:4:"file";s:34:"2015-10-05-131-east-92nd-street.md";s:3:"url";s:46:"/properties/new-york/sale/131-east-92nd-street";s:4:"data";a:52:{s:5:"title";s:20:"131 East 92nd Street";s:3:"url";s:46:"/properties/new-york/sale/131-east-92nd-street";s:9:"datestamp";i:1444017600;s:4:"city";s:8:"New York";s:5:"state";s:2:"NY";s:5:"price";s:8:"10950000";s:8:"location";a:3:{s:4:"