ddition to access through the main building. Situated on the south side of 75th Street between Third and Second Avenues, this recently updated apartment has had significant improvements including the addition of 7 Fujitsu AC units, one in every room, a brand new oversized window that was installed in the basement rear room which now allows for natural light and air to come in. In addition, there is a brand new residential Certificate of Occupancy from what had formally been a medical/professional C of O. Lovely and tasteful finishes throughout. On first floor there is an open kitchen with a large marble counter top and a front living room. Two bedrooms in the rear, with one room leading onto the outdoor patio. Full bathroom on this floor. Beautiful staircase leads you down to a lower 950 sq foot basement configured with large front and rear rooms, and a comfortable center den area. Full bathroom and wash room on this level. Access to main hallway from this level. Unit is bright and open throughout and contains a small but charming outdoor space in the rear. Condo board allows for renting out of the space. Common charges $829 per month.";s:13:"preview_image";s:59:"/assets/img/properties/sale/resized/hero-20151123153228.jpg";s:14:"photo_carousel";a:12:{i:0;s:53:"/assets/img/properties/sale/large1-20151005105150.jpg";i:1;s:53:"/assets/img/properties/sale/large2-20151005105150.jpg";i:2;s:53:"/assets/img/properties/sale/large3-20151005105150.jpg";i:3;s:53:"/assets/img/properties/sale/large4-20151005105150.jpg";i:4;s:53:"/assets/img/properties/sale/large5-20151005105151.jpg";i:5;s:53:"/assets/img/properties/sale/large6-20151005105151.jpg";i:6;s:53:"/assets/img/properties/sale/large7-20151005105151.jpg";i:7;s:53:"/assets/img/properties/sale/large8-20151005105151.jpg";i:8;s:53:"/assets/img/properties/sale/large9-20151005105151.jpg";i:9;s:54:"/assets/img/properties/sale/large10-20151005105151.jpg";i:10;s:54:"/assets/img/properties/sale/large11-20151005105151.jpg";i:11;s:54:"