"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:13:"property_type";s:9:"Apartment";s:4:"sqft";s:4:"2219";s:8:"bedrooms";s:1:"2";s:9:"bathrooms";s:1:"1";s:9:"amenities";b:0;s:12:"key_features";a:5:{i:0;s:16:"24 hour security";i:1;s:6:"Porter";i:2;s:12:"Private road";i:3;s:6:"Modern";i:4;s:9:"Renovated";}s:13:"summary_intro";s:1025:"This elegant and spacious two bedroom apartment is situated within Rutland Court; a magnificent red brick period mansion block on a private road. The 2,219 sq ft apartment offers wonderful proportions and high ceilings throughout. A generous entrance hall gives access to a stunning drawing room which interconnects to the grand dining area. A well appointed kitchen/breakfast room creates an informal place to dine. The master bedroom suite connects to a dressing room and a wonderful ensuite bathroom. The property has a further bedroom, a guest shower room, a guest cloakroom and two utility cupboards. Rutland Court is located on Rutland Gardens, a very desirable private road set behind security gates in the heart of Knightsbridge. The building is carefully managed with magnificent communal areas and 24-hour security and porterage. The property is only moments away from Hyde Park and the world class selection of shops, restaurants and amenities that the area provides, in particular Knightsbridge and Sloane Street.";s:13:"preview_image";s:58:"/assets/img/properties/sale/resized/LOR0022-BI-01-Hero.jpg";s:14:"photo_carousel";a:12:{i:0;s:45:"/assets/img/properties/sale/LOR0022-BI-01.jpg";i:1;s:45:"/assets/img/properties/sale/LOR0022-BI-02.jpg";i:2;s:45:"/assets/img/properties/sale/LOR0022-BI-04.jpg";i:3;s:45:"/assets/img/properties/sale/LOR0022-BI-05.jpg";i:4;s:45:"/assets/img/properties/sale/LOR0022-BI-06.jpg";i:5;s:45:"/assets/img/properties/sale/LOR0022-BI-07.jpg";i:6;s:45:"/assets/img/properties/sale/LOR0022-BI-08.jpg";i:7;s:45:"/assets/img/properties/sale/LOR0022-BI-09.jpg";i:8;s:45:"/assets/img/properties/sale/LOR0022-BI-10.jpg";i:9;s:45:"/assets/img/properties/sale/LOR0022-BI-11.jpg";i:10;s:45:"/assets/img/properties/sale/LOR0022-BI-12.jpg";i:11;s:45:"/assets/img/properties/sale/LOR0022-BI-13.jpg";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:0:"";s:6:"agents";a:1:{i:0;s:34:"/agents/beauchamp/karolina-fiszbak";}s:14:"ownership_type";s:9:"Apartment";s:17:"location_granular";s:11:"London, SE5";s:5:"_file";s:121:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/2-international/rental/2015-11-24-rutland-court.md";s:11:"_local_path";s:64:"/1-properties/2-international/rental/2015-11-24-rutland-court.md";s:10:"_order_key";i:1448341200;s:13:"datetimestamp";N;s:9:"datestamp";i:1448341200;s:4:"date";s:19:"November 24th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452032004;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:13:"rutland-court";s:7:"_folder";s:31:"properties/international/rental";s:9:"_basename";s:27:"2015-11-24-rutland-court.md";s:9:"_filename";s:24:"2015-11-24-rutland-court";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:9:"permalink";s:46:"/properties/international/rental/rutland-court";}}s:24:"2015-11-24-silk-house.md";a:5:{s:6:"folder";s:31:"properties/international/rental";s:4:"path";s:61:"/1-properties/2-international/rental/2015-11-24-silk-house.md";s:4:"file";s:24:"2015-11-24-silk-house.md";s:3:"url";s:43:"/properties/international/rental/silk-house";s:4:"data";a:44:{s:5:"title";s:10:"Silk House";s:2:"id";s:36:"3b9bef26-eb4d-4a8f-bd9d-dad863d7e4e7";s:3:"url";s:43:"/properties/international/rental/silk-house";s:15:"streeteasy_type";s:6:"rental";s:8:"currency";s:8:"sterling";s:5:"price";s:6:"108333";s:5:"terms";s:16:"6 month minimum ";s:17:"property_location";s:6:"London";s:8:"location";a:3:{s:4:"name";s:0:"";s:8:"latitude";s:9:"51.523652";s:9:"longitude";s:7:"-0.1566";}s:17:"streeteasy_status";s:6:"active";s:14:"openhouse_grid";a:1:{i:0;a:4:{s:4:"date";s:0:"";s:9:"startTime";s:8:"12:00 AM";s:7:"endTime";s:8:"12:00 AM";s:8:"apptOnly";s:0:"";}}s:4:"sqft";s:5:"8,833";s:8:"bedrooms";s:1:"6";s:9:"bathrooms";s:1:"6";s:9:"amenities";b:0;s:12:"key_features";a:5:{i:0;s:17:"Modern appliances";i:1;s:11:"Cinema room";i:2;s:6:"Garage";i:3;s:3:"Gym";i:4;s:21:"Staff living quarters";}s:13:"summary_intro";s:498:"Silk House is named after the explorer James Silk Buckingham (1786-1855) and is situated at the south west corner of Regent’s Park, on Cornwall Terrace. This magnificent Grade I listed home provides stunning views over the Park and has been both carefully restored to the specification of the Crown Estate and English Heritage and beautifully interior designed to provide the ultimate family accommodation. The property comprises some 8,833 sq ft as well as an adjacent Mews house of 1,140 sq ft.";s:12:"summary_full";s:2020:"<p>The property opens to a spectacular entrance hall leading through to the grand staircase which sweeps up through the building, with large windows and skylight which allows an abundance of natural light. There is also a custom made silent passenger lift to access all floors. The large family room and dining room retain their original classical proportions and have been beautifully restored, along with the library with original fireplace. The state-of-the-art kitchen is fully equipped with every modern feature including under floor heating and wine cooler.<br></p><p>The first floor comprises a principal reception room boasts classic piano Nobile dimensions, with floor areas of 530-870 sq ft and floor-to-ceiling windows providing plenty of natural light. The spacious study has pre-wire cabling, lending itself to be an office, as well as the media room which offers state of the art technology for home entertainment.<br></p><p>Situated across the whole of the second floor, the master suite comprises bedroom, ensuite bathroom, additional shower room and dressing room and enjoys traditional details, such as high skirting and intricate cornicing as well as bespoke Tyndale carpeting with Artisan silk borders add to the grandeur of this space. The master bathroom provides under heated flooring, oversized, inset bath as well as built-in high-definition plasma screen TV.<br></p><p>The third floor comprises four bedroom suites [two with shower rooms]. All bedrooms are generously proportioned, light and airy, and most can comfortably accommodate a super king size bed.<br></p><p>The lower ground floor comprises garage, vaults and staff accommodation offering a good sized double studio room, kitchenette and shower room. The gym and spa are located on the lower ground floor and have been designed to provide a serene and tranquil setting.<br></p><p>The Mews House comprises garage, living room, kitchen and guest cloakroom, with master bedroom, guest bedroom and roof terrace on the first floor.<br></p>";s:13:"preview_image";s:58:"/assets/img/properties/sale/resized/LOR0003-BI-01_Hero.jpg";s:14:"photo_carousel";a:9:{i:0;s:45:"/assets/img/properties/sale/LOR0003-BI-01.jpg";i:1;s:45:"/assets/img/properties/sale/LOR0003-BI-02.jpg";i:2;s:45:"/assets/img/properties/sale/LOR0003-BI-03.jpg";i:3;s:45:"/assets/img/properties/sale/LOR0003-BI-04.jpg";i:4;s:45:"/assets/img/properties/sale/LOR0003-BI-05.jpg";i:5;s:45:"/assets/img/properties/sale/LOR0003-BI-06.jpg";i:6;s:45:"/assets/img/properties/sale/LOR0003-BI-07.jpg";i:7;s:45:"/assets/img/properties/sale/LOR0003-BI-08.jpg";i:8;s:45:"/assets/img/properties/sale/LOR0003-BI-09.jpg";}s:8:"brochure";s:0:"";s:11:"floor_plans";s:0:"";s:13:"property_type";s:5:"House";s:6:"agents";a:1:{i:0;s:34:"/agents/beauchamp/karolina-fiszbak";}s:14:"ownership_type";s:9:"Apartment";s:17:"location_granular";s:11:"London, NW1";s:5:"_file";s:118:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/1-properties/2-international/rental/2015-11-24-silk-house.md";s:11:"_local_path";s:61:"/1-properties/2-international/rental/2015-11-24-silk-house.md";s:10:"_order_key";i:1448341200;s:13:"datetimestamp";N;s:9:"datestamp";i