:"summary_intro";s:925:"A stunning six bedroom home set over six floors. This home is situated on a beautiful tree-lined road in the heart of London and has easy access to Holborn and Chancery Lane Underground stations. Covent Garden is close by and provides an array of shops, bars and restaurants. At nearly 7000 sqft, this large family home begins with a spacious entrance hall leading to three adjacent reception rooms. The third floor hosts the master bedroom, ensuite bathroom and has a dressing room with further access to a shower room. There are an additional three bedrooms with ensuite bathrooms and another two bedrooms spread across a further two floors. The lower ground floor has a large family kitchen, separate dining area, wine cellar, utility room, vaults, a gym and outside patio area. There is also access to the private garage. The 50 foot long roof terrace on the first floor provides further valuable outside space.";s:13:"preview_image";s:65:"/assets/img/properties/sale/LOB0022-BI-02-Hero-20151123110830.jpg";s:14:"photo_carousel";a:23:{i:0;s:60:"/assets/img/properties/sale/LOB0022-BI-01-20151123102017.jpg";i:1;s:60:"/assets/img/properties/sale/LOB0022-BI-03-20151123105451.jpg";i:2;s:60:"/assets/img/properties/sale/LOB0022-BI-04-20151123105451.jpg";i:3;s:60:"/assets/img/properties/sale/LOB0022-BI-05-20151123105458.jpg";i:4;s:60:"/assets/img/properties/sale/LOB0022-BI-06-20151123105458.jpg";i:5;s:60:"/assets/img/properties/sale/LOB0022-BI-07-20151123105527.jpg";i:6;s:60:"/assets/img/properties/sale/LOB0022-BI-08-20151123105527.jpg";i:7;s:60:"/assets/img/properties/sale/LOB0022-BI-09-20151123105553.jpg";i:8;s:60:"/assets/img/properties/sale/LOB0022-BI-10-20151123105553.jpg";i:9;s:60:"/assets/img/properties/sale/LOB0022-BI-11-20151123105603.jpg";i:10;s:60:"/assets/img/properties/sale/LOB0022-BI-12-20151123105603.jpg";i:11;s:60:"/assets/img/properties/sale/LOB0022-BI-13-20151123105609.jpg";i:12;s:60:"/assets/img/properties/sale/LOB0022-BI-14-20151123105609.jpg