chen, master bedroom with ensuite bathroom, dressing room and a further 4 bedrooms with ensuite facilities. Amenities include an orangery, garden, off street parking behind electric gates, store room and storage area.";s:13:"preview_image";s:50:"/assets/img/properties/sale/LOB0025-BI-01-Hero.jpg";s:14:"photo_carousel";a:25:{i:0;s:68:"/assets/img/properties/sale/resized/LOB0025-BI-01-20151109225300.jpg";i:1;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-02.jpg";i:2;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-03.jpg";i:3;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-04.jpg";i:4;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-05.jpg";i:5;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-06.jpg";i:6;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-07.jpg";i:7;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-08.jpg";i:8;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-09.jpg";i:9;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-10.jpg";i:10;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-11.jpg";i:11;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-12.jpg";i:12;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-13.jpg";i:13;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-14.jpg";i:14;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-15.jpg";i:15;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-16.jpg";i:16;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-17.jpg";i:17;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-18.jpg";i:18;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-19.jpg";i:19;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-20.jpg";i:20;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-21.jpg";i:21;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-22.jpg";i:22;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-23.jpg";i:23;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-24.jpg";i:24;s:53:"/assets/img/properties/sale/resized/LOB0025-BI-25.jpg";}s:8:"brochure";s:0