_key";s:7:"page.md";s:13:"datetimestamp";N;s:9:"datestamp";N;s:4:"date";N;s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452032034;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:4:"page";s:7:"_folder";s:6:"agents";s:9:"_basename";s:7:"page.md";s:9:"_filename";s:4:"page";s:9:"_is_entry";i:0;s:8:"_is_page";i:1;s:3:"url";s:16:"/agents/garfield";s:9:"permalink";s:16:"/agents/garfield";}}}s:15:"agents/garfield";a:14:{s:23:"2015-08-18-alex-yoel.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:42:"/2-agents/garfield/2015-08-18-alex-yoel.md";s:4:"file";s:23:"2015-08-18-alex-yoel.md";s:3:"url";s:26:"/agents/garfield/alex-yoel";s:4:"data";a:26:{s:5:"title";s:9:"Alex Yoel";s:5:"image";s:34:"/assets/img/agents/AlexYoel-03.jpg";s:5:"phone";s:12:"212-574-6970";s:5:"email";s:24:"ayoel@lesliegarfield.com";s:5:"press";s:0:"";s:4:"info";s:1381:"<p>Alex has a way of conducting business that can only be defined as direct; he aims above all to completely and truthfully convey information to best serve his clients. His integrity translates into a thorough marketing process which yields peak-of-the-market results for sellers. He has developed a real expertise which allows him to provide flexible service for clients with diverse wants and needs.<br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; font-size: 12px; line-height: 17.1429px;"><br style="box-sizing: border-box; color: rgb(102, 102, 102); font-family: 'Century Gothic', sans-serif; font-size: 12px; line-height: 17.1429px;">With a focus specifically on the sale of townhouses, Alex has built a wide knowledge base of every aspect of the business including grand scheme market dynamics, negotiation, property valuation, and physical townhouse structure. He also has a trusted network of real estate attorneys, trust and estate attorneys, contractors, architects, qualified intermediaries, and other real estate professionals that can be of great use to any owner.</p><p>Outside the real estate world, Alex enjoys spending time with his wife in their Park Slope home. He also has a strong interest in music; he plays both guitar and classical piano, and composes songs and classical music in his spare time.</p>";s:9:"datestamp";i:1439870400;s:6:"author";s:1:"1";s:5:"_file";s:99:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/2-agents/garfield/2015-08-18-alex-yoel.md";s:11:"_local_path";s:42:"/2-agents/garfield/2015-08-18-alex-yoel.md";s:10:"_order_key";i:1439870400;s:13:"datetimestamp";N;s:4:"date";s:17:"August 18th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452032027;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:9:"alex-yoel";s:7:"_folder";s:15:"agents/garfield";s:9:"_basename";s:23:"2015-08-18-alex-yoel.md";s:9:"_filename";s:20:"2015-08-18-alex-yoel";s:9:"_is_entry";i:1;s:8:"_is_page";i:0;s:3:"url";s:26:"/agents/garfield/alex-yoel";s:9:"permalink";s:26:"/agents/garfield/alex-yoel";}}s:29:"2015-08-20-caylyn-sullivan.md";a:5:{s:6:"folder";s:15:"agents/garfield";s:4:"path";s:48:"/2-agents/garfield/2015-08-20-caylyn-sullivan.md";s:4:"file";s:29:"2015-08-20-caylyn-sullivan.md";s:3:"url";s:32:"/agents/garfield/caylyn-sullivan";s:4:"data";a:26:{s:5:"title";s:15:"Caylyn Sullivan";s:5:"image";s:46:"/assets/img/agents/medresCaylynSullivan-03.jpg";s:5:"phone";s:12:"212-574-6966";s:5:"email";s:28:"csullivan@lesliegarfield.com";s:5:"press";a:1:{i:0;a:4:{s:5:"image";s:61:"/assets/img/agents/Observer-20151009154022-20151104145713.png";s:4:"file";s:0:"";s:4:"text";s:0:"";s:4:"link";s:95:"http://observer.com/2015/09/townhouse-specialist-leslie-garfield-parts-ways-with-his-townhouse/";}}s:4:"info";s:21856:"<!--[if gte mso 9]><xml>
