te with only townhouse streets. It has also ushered in a new focus on real estate. Famously home to artists and galleries galore, your neighborhood is quickly gaining ground with tech entrepreneurs, too. Great restaurants and shopping only add to the appeal. As Chelsea continues to develop and transform with hip restaurants, fresh retail and new architecture,it is a hot ticket for buyers today.";s:12:"sub_headline";s:59:"Expert views, opinions and thinking from the Garfield team.";s:4:"left";s:2:"49";s:9:"right_top";s:4:"1336";s:12:"right_bottom";a:1:{i:0;a:2:{s:9:"price_tag";s:5:"11.4M";s:14:"simple_graphic";s:0:"";}}s:18:"border_coordinates";a:10:{i:0;a:1:{s:18:"longitude_latitude";s:29:"-74.0070176,40.75473449999999";}i:1;a:1:{s:18:"longitude_latitude";s:28:"-74.008627,40.75083329999999";}i:2;a:1:{s:18:"longitude_latitude";s:21:"-74.0087289,40.750118";}i:3;a:1:{s:18:"longitude_latitude";s:22:"-74.0085304,40.7496629";}i:4;a:1:{s:18:"longitude_latitude";s:22:"-74.0080905,40.7483949";}i:5;a:1:{s:18:"longitude_latitude";s:22:"-74.0081549,40.7477121";}i:6;a:1:{s:18:"longitude_latitude";s:22:"-74.0089917,40.7424938";}i:7;a:1:{s:18:"longitude_latitude";s:30:"-73.9968467,40.737218000000006";}i:8;a:1:{s:18:"longitude_latitude";s:22:"-73.9894117,40.7473951";}i:9;a:1:{s:18:"longitude_latitude";s:29:"-74.0070176,40.75473449999999";}}s:8:"location";a:3:{s:4:"name";s:12:"chelasea, ny";s:8:"latitude";s:10:"40.7471982";s:9:"longitude";s:11:"-74.0027046";}s:10:"zoom_level";s:2:"15";s:5:"_file";s:120:"/Users/Philippe/www/sites/lesliegarfield/wwwroot/_content/5-neighborhoods/individual_neighborhoods/2015-09-25-chelsea.md";s:11:"_local_path";s:63:"/5-neighborhoods/individual_neighborhoods/2015-09-25-chelsea.md";s:10:"_order_key";i:1443153600;s:13:"datetimestamp";N;s:9:"datestamp";i:1443153600;s:4:"date";s:20:"September 25th, 2015";s:4:"time";N;s:7:"numeric";N;s:13:"last_modified";i:1452032038;s:10:"_is_hidden";b:0;s:9:"_is_draft";b:0;s:4:"slug";s:7:"chelsea";s:7:"_folder";s:38:"neig